import React from 'react'
import { StyleSheet, View, Image, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';


import HomeStack from '../navigation/home-navigator'
import Explore from '../screens/explore'
import Lists from '../screens/lists'
import Profile from '../screens/profile'
import { withOrientation } from 'react-navigation';


const Tab = createBottomTabNavigator();

const TabNav = () => {
  return (
			<Tab.Navigator
			tabBarOptions={{showLabel: false}}>
				<Tab.Screen name = "Home" component = {HomeStack} 
				options = {
					{tabBarIcon: ({focused}) => (
						<View style = {styles.elements}>
							<Image 
							source = {require('../../assets/Ghost_face.png')}
							style = {{
								tintColor: focused ? '#FF267C' : '#BDBDBD',
								width: 25,
								height: 25}}></Image>
								<Text 
								style = {{
									color: focused ? '#FF267C' : '#BDBDBD', 
									fontSize: 12,
									fontWeight: focused ? '500' : 'normal'}}>Home</Text>
						</View>
					)}}/>
				<Tab.Screen name ="Explore" component = {Explore}
				options = {
					{tabBarIcon: ({focused}) => (
						<View style = {styles.elements}>
							<Image 
							source = {require('../../assets/Ghost_face.png')}
							style = {{
								tintColor: focused ? '#FF267C' : '#BDBDBD',
								width: 25,
								height: 25}}></Image>
								<Text 
								style = {{
									color: focused ? '#FF267C' : '#BDBDBD', 
									fontSize: 12,
									fontWeight: focused ? '500' : 'normal'}}>
									My Lists</Text>
						</View>
					)}}/>
				<Tab.Screen name ="Lists" component = {Lists}
				options = {
					{tabBarIcon: ({focused}) => (
						<View style = {styles.elements}>
							<Image 
							source = {require('../../assets/Ghost_face.png')}
							style = {{
								tintColor: focused ? '#FF267C' : '#BDBDBD',
								width: 25,
								height: 25}}></Image>
								<Text 
								style = {{
									color: focused ? '#FF267C' : '#BDBDBD', 
									fontSize: 12,
									fontWeight: focused ? '500' : 'normal'}}>
									Lists</Text>
						</View>
					)}}/>
				<Tab.Screen name ="Profile" component = {Profile}
				options = {
					{tabBarIcon: ({focused}) => (
						<View style = {styles.elements}>
							<Image 
							source = {require('../../assets/Ghost_face.png')}
							style = {{
								tintColor: focused ? '#FF267C' : '#BDBDBD',
								width: 25,
								height: 25}}></Image>
								<Text 
								style = {{
									color: focused ? '#FF267C' : '#BDBDBD', 
									fontSize: 12,
									fontWeight: focused ? '500' : 'normal'}}>
									Profile</Text>
						</View>
					)}}/>
			</Tab.Navigator>

  );
}

const styles = StyleSheet.create({
	nav: {
		color: 'white'
	},
	elements: {
		alignItems: 'center', 
		justifyContent: 'center'
	}
})

export default TabNav;
